const Footer = () => {
  return (
    <footer>
      <ul class="social-icons">
        <li>
          <img src="https://w7.pngwing.com/pngs/671/774/png-transparent-instagram-instagram-new-design-round-social-media-instagram-new-icon.png" alt="instagram" />
        </li>
        <li>
          <img src="https://png.pngtree.com/element_our/sm/20180509/sm_5af2ca6386091.jpg" alt="facebook" />
        </li>
        <li>
          <img src="https://static.vecteezy.com/system/resources/previews/018/930/745/original/twitter-logo-twitter-icon-transparent-free-free-png.png" alt="twitter" />
        </li>
      </ul>
    </footer>
  );
};
export default Footer;
